import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
export default function Reciept() {

  const [carData , setcarData] = useState([]);
  const numberPlate = useParams();
  console.log(numberPlate);
  useEffect(()=>{
    axios.get(`http://localhost:8000/api/licenses/${numberPlate}`.then((res)=>{setcarData(res.data.car)}));
  },[])
  return (
    <>
      {
        carData.map(data => <div key={data._id}>
          <p>{data.numberPlate}</p>
          <p>{data.entryLocation}</p>
          <p>{data.exitLocation}</p>
          <p>{data.toll}</p>
        </div>)
      }
    </>
  )
}
